    def format_number(self, text):
        # Removendo caracteres não numéricos
        text = ''.join(filter(str.isdigit, text))

        # Convertendo o texto para um número decimal
        try:
                number = int(text) / 100
        except ValueError:
                number = 0

        # Formatando o número como uma string com pontos e vírgulas
        formatted_text = f'{number:,.2f}'.replace(',', 'X').replace('.', ',').replace('X', '.')

        # Atualizando o texto do campo de entrada com o texto formatado
        self.insere_preco_vendas.blockSignals(True)
        self.insere_preco_vendas.setText(formatted_text)
        self.insere_preco_vendas.blockSignals(False)

